### Ethereum Blockchain Messenger Smart Contract

Below is a Solidity smart contract that meets the specified requirements. This contract, named `BlockchainMessenger`, allows users to save messages on the blockchain, update these messages privately, and count the number of updates.

```solidity
pragma solidity ^0.8.0;

contract BlockchainMessenger {
    // Mapping of message IDs to their respective message contents
    mapping (uint256 => string) public messages;

    // Mapping of message IDs to their update counts
    mapping (uint256 => uint256) public updateCounts;

    // Mapping of message IDs to their authors (deployer's address)
    mapping (uint256 => address) public authors;

    // Counter for generating unique message IDs
    uint256 public messageIdCounter = 0;

    // Function to save a new message on the blockchain
    function saveMessage(string memory _message) public {
        // Generate a new message ID
        messageIdCounter++;

        // Store the message and its author
        messages[messageIdCounter] = _message;
        authors[messageIdCounter] = msg.sender;

        // Initialize the update count to 0
        updateCounts[messageIdCounter] = 0;
    }

    // Function to update a message privately
    function updateMessage(uint256 _id, string memory _newMessage) public {
        // Check if the message exists and the caller is its author
        require(_id > 0 && messages[_id] != "", "Message does not exist.");
        require(msg.sender == authors[_id], "Only the author can update the message.");

        // Update the message and increment the update count
        messages[_id] = _newMessage;
        updateCounts[_id]++;
    }

    // Function to get the message content
    function getMessage(uint256 _id) public view returns (string memory) {
        // Check if the message exists
        require(_id > 0 && messages[_id] != "", "Message does not exist.");

        // Return the message content
        return messages[_id];
    }

    // Function to get the update count of a message
    function getUpdateCount(uint256 _id) public view returns (uint256) {
        // Check if the message exists
        require(_id > 0 && messages[_id] != "", "Message does not exist.");

        // Return the update count
        return updateCounts[_id];
    }
}
```

### Explanation

- **`saveMessage` function**: This function allows users to save new messages on the blockchain. It generates a unique message ID, stores the message content, and records the author (the deployer's address). The update count is initialized to 0.

- **`updateMessage` function**: This function enables users to update their saved messages privately. It checks if the message exists and if the caller is its author. If both conditions are met, it updates the message content and increments the update count.

- **`getMessage` function**: This function retrieves the content of a message given its ID. It checks if the message exists before returning its content.

- **`getUpdateCount` function**: This function returns the update count of a message given its ID. It checks if the message exists before returning the update count.

